import React from 'react';
import vid from '../../my-project/src/Vid/lv_0_20230402134428.mp4'

const About = () => {
  return (
    <div>
      <div>
        <video src={vid} autoPlay='true' className='vid' loop autoPlay muted playsInline/>
      </div>
    </div>
  );
}

export default About;
